import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import { fetchOrdersByStaffId } from '../actions/staffAction'

const StaOrderListScreen = () => {
  const { id } = useParams()
  const dispatch = useDispatch()
  const staffOrders = useSelector(state => state.staffOrders)
  const { loading, error, orders } = staffOrders

  useEffect(() => {
    if (id) {
      dispatch(fetchOrdersByStaffId(id))
    }
  }, [dispatch, id])

  return (
    <div>
      <h1>Staff Orders for {id}</h1>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>Error: {error}</p>
      ) : (
        <ul>
          {orders.map(order => (
            <li key={order._id}>
              <p>Order ID: {order._id}</p>
              {order.orderItems.map((item, index) => (
                <div key={index}>
                  <p>Staff ID: {item.staff}</p>
                  <p>Date: {item.date}</p>
                  <p>Slot: {item.slot}</p>
                  <p>Status: {item.status}</p>
                </div>
              ))}
            </li>
          ))}
        </ul>
      )}
    </div>
  )
}

export default StaOrderListScreen
